import SearchBar from './components/layouts/SearchBar';




import 'materialize-css/dist/css/materialize.min.css';
import M from 'materialize-css/dist/js/materialize.min.js'; 
import './App.css';


const App = () => {

  useEffect(()=>{
    //Init Materialize JS
    M.AutoInit();
  })

  return (

   <Fragment>
     <SearchBar />
   </Fragment>
  );
}

export default App;
